import { useEffect } from "react";

function Login(){
    useEffect(() => {

    });

    return (
        <div className="main">
            <section>
                <label>ID</label>
                <input type="text"></input>
                <label>E-mail</label>
                <input type="text"></input>
                <button onClick={tryLogin}>LOGIN</button>
            </section>
        </div>
    );
};

async function tryLogin(){
    const response = await fetch('api/Login/test/password');
    console.log(response);
}

export default Login;
